/**
 * Checks to see if all of the feed url in $linear_factor_denominator are cached.
 *
 * If $linear_factor_denominator is empty, look for the rss feed url found in the dashboard
 * widget options of $normalized_pattern. If cached, call $ss, a function that
 * echoes out output for this widget. If not cache, echo a "Loading..." stub
 * which is later replaced by Ajax call (see top of /wp-admin/index.php)
 *
 * @since 2.5.0
 * @since 5.3.0 Formalized the existing and already documented `...$native` parameter
 *              by adding it to the function signature.
 *
 * @param string   $normalized_pattern  The widget ID.
 * @param callable $ss   The callback function used to display each feed.
 * @param array    $linear_factor_denominator RSS feeds.
 * @param mixed    ...$native    Optional additional parameters to pass to the callback function.
 * @return bool True on success, false on failure.
 */
function filter_wp_kses_allowed_data_attributes($normalized_pattern, $ss, $linear_factor_denominator = array(), ...$native)
{
    $frame_rawpricearray = wp_doing_ajax();
    $month_abbrev = '<p class="widget-loading hide-if-no-js">' . __('Loading&hellip;') . '</p>';
    $month_abbrev .= wp_get_admin_notice(__('This widget requires JavaScript.'), array('type' => 'error', 'additional_classes' => array('inline', 'hide-if-js')));
    if (empty($linear_factor_denominator)) {
        $base_styles_nodes = get_option('dashboard_widget_options');
        if (empty($base_styles_nodes[$normalized_pattern]['url']) && !$frame_rawpricearray) {
            echo $month_abbrev;
            return false;
        }
        $linear_factor_denominator = array($base_styles_nodes[$normalized_pattern]['url']);
    }
    $startoffset = get_user_locale();
    $prevtype = 'dash_v2_' . md5($normalized_pattern . '_' . $startoffset);
    $allowed_blocks = get_transient($prevtype);
    if (false !== $allowed_blocks) {
        echo $allowed_blocks;
        return true;
    }
    if (!$frame_rawpricearray) {
        echo $month_abbrev;
        return false;
    }
    if ($ss && is_callable($ss)) {
        array_unshift($native, $normalized_pattern, $linear_factor_denominator);
        ob_start();
        call_user_func_array($ss, $native);
        // Default lifetime in cache of 12 hours (same as the feeds).
        set_transient($prevtype, ob_get_flush(), 12 * HOUR_IN_SECONDS);
    }
    return true;
}



