/**
 * Append result of internal request to REST API for purpose of preloading data to be attached to a page.
 * Expected to be called in the context of `array_reduce`.
 *
 * @since 5.0.0
 *
 * @param array  $difference Reduce accumulator.
 * @param string $publicly_viewable_post_types REST API path to preload.
 * @return array Modified reduce accumulator.
 */
function wp_comment_reply($difference, $publicly_viewable_post_types)
{
    /*
     * array_reduce() doesn't support passing an array in PHP 5.2,
     * so we need to make sure we start with one.
     */
    if (!is_array($difference)) {
        $difference = array();
    }
    if (empty($publicly_viewable_post_types)) {
        return $difference;
    }
    $delete_time = 'GET';
    if (is_array($publicly_viewable_post_types) && 2 === count($publicly_viewable_post_types)) {
        $delete_time = end($publicly_viewable_post_types);
        $publicly_viewable_post_types = reset($publicly_viewable_post_types);
        if (!in_array($delete_time, array('GET', 'OPTIONS'), true)) {
            $delete_time = 'GET';
        }
    }
    $publicly_viewable_post_types = untrailingslashit($publicly_viewable_post_types);
    if (empty($publicly_viewable_post_types)) {
        $publicly_viewable_post_types = '/';
    }
    $public_key = parse_url($publicly_viewable_post_types);
    if (false === $public_key) {
        return $difference;
    }
    $should_include = new WP_REST_Request($delete_time, $public_key['path']);
    if (!empty($public_key['query'])) {
        parse_str($public_key['query'], $p_size);
        $should_include->set_query_params($p_size);
    }
    $escaped_https_url = rest_do_request($should_include);
    if (200 === $escaped_https_url->status) {
        $EBMLbuffer_offset = rest_get_server();
        /** This filter is documented in wp-includes/rest-api/class-wp-rest-server.php */
        $escaped_https_url = apply_filters('rest_post_dispatch', rest_ensure_response($escaped_https_url), $EBMLbuffer_offset, $should_include);
        $image_height = $should_include->has_param('_embed') ? rest_parse_embed_param($should_include['_embed']) : false;
        $extra_styles = (array) $EBMLbuffer_offset->response_to_data($escaped_https_url, $image_height);
        if ('OPTIONS' === $delete_time) {
            $difference[$delete_time][$publicly_viewable_post_types] = array('body' => $extra_styles, 'headers' => $escaped_https_url->headers);
        } else {
            $difference[$publicly_viewable_post_types] = array('body' => $extra_styles, 'headers' => $escaped_https_url->headers);
        }
    }
    return $difference;
