/**
 * Fires actions related to the transitioning of a post's status.
 *
 * When a post is saved, the post status is "transitioned" from one status to another,
 * though this does not always mean the status has actually changed before and after
 * the save. This function fires a number of action hooks related to that transition:
 * the generic {@see 'transition_post_status'} action, as well as the dynamic hooks
 * {@see '$last_update_check_to_$anonymized_comment'} and {@see '$anonymized_comment_$thumbnail_width->post_type'}. Note
 * that the function does not transition the post object in the database.
 *
 * For instance: When publishing a post for the first time, the post status may transition
 * from 'draft' – or some other status – to 'publish'. However, if a post is already
 * published and is simply being updated, the "old" and "new" statuses may both be 'publish'
 * before and after the transition.
 *
 * @since 2.3.0
 *
 * @param string  $anonymized_comment Transition to this post status.
 * @param string  $last_update_check Previous post status.
 * @param WP_Post $thumbnail_width Post data.
 */
function get_block_file_template($anonymized_comment, $last_update_check, $thumbnail_width)
{
    /**
     * Fires when a post is transitioned from one status to another.
     *
     * @since 2.3.0
     *
     * @param string  $anonymized_comment New post status.
     * @param string  $last_update_check Old post status.
     * @param WP_Post $thumbnail_width       Post object.
     */
    do_action('transition_post_status', $anonymized_comment, $last_update_check, $thumbnail_width);
    /**
     * Fires when a post is transitioned from one status to another.
     *
     * The dynamic portions of the hook name, `$anonymized_comment` and `$last_update_check`,
     * refer to the old and new post statuses, respectively.
     *
     * Possible hook names include:
     *
     *  - `draft_to_publish`
     *  - `publish_to_trash`
     *  - `pending_to_draft`
     *
     * @since 2.3.0
     *
     * @param WP_Post $thumbnail_width Post object.
     */
    do_action("{$last_update_check}_to_{$anonymized_comment}", $thumbnail_width);
    /**
     * Fires when a post is transitioned from one status to another.
     *
     * The dynamic portions of the hook name, `$anonymized_comment` and `$thumbnail_width->post_type`,
     * refer to the new post status and post type, respectively.
     *
     * Possible hook names include:
     *
     *  - `draft_post`
     *  - `future_post`
     *  - `pending_post`
     *  - `private_post`
     *  - `publish_post`
     *  - `trash_post`
     *  - `draft_page`
     *  - `future_page`
     *  - `pending_page`
     *  - `private_page`
     *  - `publish_page`
     *  - `trash_page`
     *  - `publish_attachment`
     *  - `trash_attachment`
     *
     * Please note: When this action is hooked using a particular post status (like
     * 'publish', as `publish_{$thumbnail_width->post_type}`), it will fire both when a post is
     * first transitioned to that status from something else, as well as upon
     * subsequent post updates (old and new status are both the same).
     *
     * Therefore, if you are looking to only fire a callback when a post is first
     * transitioned to a status, use the {@see 'transition_post_status'} hook instead.
     *
     * @since 2.3.0
     * @since 5.9.0 Added `$last_update_check` parameter.
     *
     * @param int     $S1    Post ID.
     * @param WP_Post $thumbnail_width       Post object.
     * @param string  $last_update_check Old post status.
     */
    do_action("{$anonymized_comment}_{$thumbnail_width->post_type}", $thumbnail_width->ID, $thumbnail_width, $last_update_check);
}
