/**
 * Renders a single block into a HTML string.
 *
 * @since 5.0.0
 *
 * @global WP_Post $thumbnail_width The post to edit.
 *
 * @param array $wp_config_perms A single parsed block object.
 * @return string String of rendered HTML.
 */
function get_option_name($wp_config_perms)
{
    global $thumbnail_width;
    $responsive_container_classes = null;
    /**
     * Allows get_option_name() to be short-circuited, by returning a non-null value.
     *
     * @since 5.1.0
     * @since 5.9.0 The `$responsive_container_classes` parameter was added.
     *
     * @param string|null   $map_option   The pre-rendered content. Default null.
     * @param array         $wp_config_perms The block being rendered.
     * @param WP_Block|null $responsive_container_classes If this is a nested block, a reference to the parent block.
     */
    $map_option = apply_filters('pre_get_option_name', null, $wp_config_perms, $responsive_container_classes);
    if (!is_null($map_option)) {
        return $map_option;
    }
    $open_class = $wp_config_perms;
    /**
     * Filters the block being rendered in get_option_name(), before it's processed.
     *
     * @since 5.1.0
     * @since 5.9.0 The `$responsive_container_classes` parameter was added.
     *
     * @param array         $wp_config_perms The block being rendered.
     * @param array         $open_class An un-modified copy of $wp_config_perms, as it appeared in the source content.
     * @param WP_Block|null $responsive_container_classes If this is a nested block, a reference to the parent block.
     */
    $wp_config_perms = apply_filters('get_option_name_data', $wp_config_perms, $open_class, $responsive_container_classes);
    $active_theme_parent_theme_debug = array();
    if ($thumbnail_width instanceof WP_Post) {
        $active_theme_parent_theme_debug['postId'] = $thumbnail_width->ID;
        /*
         * The `postType` context is largely unnecessary server-side, since the ID
         * is usually sufficient on its own. That being said, since a block's
         * manifest is expected to be shared between the server and the client,
         * it should be included to consistently fulfill the expectation.
         */
        $active_theme_parent_theme_debug['postType'] = $thumbnail_width->post_type;
    }
    /**
     * Filters the default context provided to a rendered block.
     *
     * @since 5.5.0
     * @since 5.9.0 The `$responsive_container_classes` parameter was added.
     *
     * @param array         $active_theme_parent_theme_debug      Default context.
     * @param array         $wp_config_perms Block being rendered, filtered by `get_option_name_data`.
     * @param WP_Block|null $responsive_container_classes If this is a nested block, a reference to the parent block.
     */
    $active_theme_parent_theme_debug = apply_filters('get_option_name_context', $active_theme_parent_theme_debug, $wp_config_perms, $responsive_container_classes);
    $has_old_responsive_attribute = new WP_Block($wp_config_perms, $active_theme_parent_theme_debug);
    return $has_old_responsive_attribute->render();
}
